// NotFound.js
import React from "react";

const Start = () => {
  return (
    <>
    <div class="flex">
  <h1 class="text-[36px] font-bold mb-5 mt-14">مرحبا بك 
  </h1>
  
</div>

<div class="flex ">
  <button onclick="window.location.href='doctor/login.html'" type="button" class="text-white  bg-gray-800 hover:bg-green-600 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 me-2 mb-2 dark:bg-blue-600 dark:hover:bg-blue-700 focus:outline-none dark:focus:ring-blue-800 ">
    طبيب
  </button>
  <button onclick="window.location.href='pharmacist/login.html'" type="button" class="text-white bg-gray-800 hover:bg-green-600 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 me-2 mb-2 dark:bg-blue-600 dark:hover:bg-blue-700 focus:outline-none dark:focus:ring-blue-800">
    صيدلي
  </button>
  <button onclick="window.location.href='patient/form.html'" type="button" class="text-white bg-gray-800 hover:bg-green-600 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 me-2 mb-2 dark:bg-blue-600 dark:hover:bg-blue-700 focus:outline-none dark:focus:ring-blue-800">
    مريض
  </button>
  <button onclick="window.location.href='administrative/form.html'" type="button" class="text-white bg-gray-800 hover:bg-green-600 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 me-2 mb-2 dark:bg-blue-600 dark:hover:bg-blue-700 focus:outline-none dark:focus:ring-blue-800">
    اداري
  </button>
</div>
    </>
  );
};

export default Start;
